import React from 'react'
import JsonData from '../contract.json'
import "./CSS/Table.css"

function ProductTable(props) {
  const { products } = props;
  const [sortedField, setSortedField] = React.useState(null);
  let sortedProducts = [...products];
  sortedProducts.sort((a, b) => {
    if (a.contract_name < b.contract_name) {
      return -1;
    }
    if (a.contract_name > b.contract_name) {
      return 1;
    }
    return 0;
  });
  return (
    <table>
      <caption>Job Listings</caption>
      
      <thead>
        <tr>
          <th>ID</th>
          <th>ComID</th>
          <th>ConName</th>
          <th>ConLen</th>
          <th>ConVal</th>
          <th>ConDes</th>
          <th>ProLan</th>
          <th>Loc</th>
          <th>Open</th>
          <th>Date</th>
        </tr>
      </thead>
      <tbody>
        {products.map(product => (
          <tr key={product.id}>
            <td>{product.contract_name}</td>
            <td>{product.contract_length}</td>
            <td>{product.contract_value}</td>
            <td>{product.description}</td>
            <td>{product.progamming_language}</td>
            <td>{product.location}</td>
            <td>{product.open}</td>
            <td>{product.date}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}


export default JsonDataDisplay;
